import React, { useState } from "react";

export default function counter() {
  const [counter, setCounter] = useState(0);
  return (
    <div>
      <h1>CounterHook : {counter}</h1>
      <button
        onClick={() => {
          setCounter(counter + 1);
        }}
      >
        +
      </button>
      <button
        onClick={() => {
          setCounter(counter - 1);
        }}
      >
        -
      </button>
    </div>
  );
}
